import { Chart } from "react-google-charts";
import {Card} from 'react-bootstrap';
import React from 'react';

const BarChart = () =>{

    return(
        <div style={{marginTop:"50px", marginLeft:"400px"}}>
            <Card className="dimn shadow-5-l grow">
    <Card.Body>
    <Chart
        width={'700px'}
        height={'500px'}
        chartType="Bar"
        loader={<div>Loading Chart</div>}
        data={[
            ['Month', 'Patients', 'Docotors', 'Diagnostics'],
            ['August', 200, 1000, 400],
            ['September', 250, 1170, 450],
            ['October', 300, 1120, 600],
            ['November', 350, 1030, 550],
        ]}
        options={{
            // Material design options
            chart: {
            title: 'Spend Analysis',
            subtitle: 'Patients, Doctors, Diagnostics and X-rays',
            },
        }}
        // For tests
        rootProps={{ 'data-testid': '2' }}
        />
    </Card.Body>
  </Card>

        </div>
    );
}

export default BarChart;
